INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(5, 8, 2, 'Piotru i Wilk. Reinterpretacja', 'Piotru i Wilk. Reinterpretacja', 'Grupa Artystyczna Koncentrat to dugofalowy, niezaleny, midzynarodowy projekt taneczny zaoony w 2005 roku przez choreografa Rafaa Dziemidoka i projektantk owietlenia/przestrzeni Ew Garniec. Obecnie Koncentrat dziaa w Berlinie i Warszawie, realizujc taneczne, performerskie i wizualne projekty, z udziaem artystw z rnych dziedzin sztuki. Koncentrat realizuje spektakle sceniczne, jak i site-specific, z amatorami, jak i zawodowcami, grupowe, jak i mniejsze formy, nieustannie poszukujc precyzji w opowiadanych przez swych twrcw osobistych historiach.', '2017-02-18 19:05:00', , '2017-01-01 19:05:00'),
(6, 8, 2, 'Ojczyzna', 'Ojczyzna', 'Spektakl Teatru Polskiego w Poznaniu, dla dzieci od lat 6, cena biletu - 8 z', '2017-02-20 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(7, 8, 2, 'Warsztaty do filmw Przyja', 'Warsztaty do filmw Przyja', 'Podczas warsztatw przygldamy si tematowi Przyja, poruszanemu w rnych aspektach przez kady z filmw, prezentowanych podczas pokazu filmw krtkometraowych Mae Mrwkojady na Hurra! ART!\\n\\nW zalenoci od dynamiki grupy wykorzystane zostan dziaania ruchowe, rysowanie lub tworzenie figur z papieru, itp. Dziki warsztatom rodzice odkrywaj, e ich dzieci wietnie rozumiej filmy i maj niesamowit wyobrani, ktr mog wykorzysta do wsplnej zabawy. \\n\\ndla dzieci od lat 6\\nwstp wolny, obowizuje rezerwacja miejsc', '2017-02-26 19:05:00', , '2017-01-01 19:05:00'),
(8, 12, 4, 'Koncert Jerzego Poomskiego', 'Koncert Jerzego Poomskiego', 'Serdecznie zapraszamy na koncert Jerzego Poomskiego, ktry odbdzie si 18 wrzenia 2016 r. o godz. 18.00 w dniu 83 urodzin Pana Jerzego.\\nBilety do nabycia w Impresariacie Artystycznym MCK w cenie:\\n normalny 40 z.\\n dla suchaczy Uniwersytetu Trzeciego Wieku i grup powyej 5 osb 30 z.', '2017-03-02 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(9, 12, 4, 'Memorial To Miles Jazz Festival 2016', 'Memorial To Miles Jazz Festival 2016', 'Bezpatne wejciwki na kady z koncertw bd dostpne od 22 sierpnia w Kasie KCK.', '2017-03-04 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(10, 12, 4, 'Reggae Fest', 'Reggae Fest', 'Federacja Stowarzysze Kulturotwrczych Baza Zboowa zaprasza na Zboowa Etno-Reggae Fest.\\nKoncerty - Klub Kotownia i scena w patio obok klubu.\\n Bilety - 10 z (jednodniowy - przedsprzeda), 15 z (jednodniowy - w dniu koncertu)', '2017-03-07 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(11, 7, 4, 'Disco Kadzielnia 3 czyli Wielkie poegnanie lata!!', 'Disco Kadzielnia 3 czyli Wielkie poegnanie lata!!!', 'Proponujemy udzia w koncercie DISCO KADZIELNIA 3 czyli wielkie poegnanie lata!!!, ktry odbdzie si 2 wrzenia o godzinie 19.30, w Amfiteatrze Kadzielnia w Kielcach. Koncerty z cyklu Disco Kadzielnia stay si absolutnym hitem z nadkompletem widowni bawicym si na stojco przez 2,5 godziny.\\n Take w tym roku bdzie to wielkie widowisko z udziaem tym razem take gwiazd zagranicznych: Boney M. i Loony oraz najpopularniejszych wykonawcw polskiego dance''u  wystpi m.in.: Weekend, Tomasz Niecik, Shazza, Long&Junior, Classic, Masters, obuzy. \\n\\nCeny biletw:\\n SUPERVIP -140 z\\n VIP1 - 120 z\\n VIP2 - 100 z\\n Sektor A - 80 z (w dniu koncertu 90 z)\\n Sektor B  70 z (w dniu koncertu 80 z)', '2017-03-06 19:05:00', , '2017-01-01 19:05:00'),
(12, 7, 4, 'Happysad&OCN', 'Happysad&OCN', 'Koncert zespow Happysad&OCN na Amfiteatrze Kadzielnia.\\n Serdecznie zapraszamy!', '2017-02-14 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(13, 7, 4, 'Koncert Symfoniczny Pieni Szczcia', 'Koncert Symfoniczny Pieni Szczcia', 'Koncert Pieni Szczcia, pod dyrygentur Piotra Rubika.\\nOrganizatorem jest agencja Ewa-K.\\nSerdecznie zapraszamy.', '2017-02-17 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(14, 7, 4, 'Koncert Charytatywny', 'Koncert Charytatywny', 'Na koncercie w Amfiteatrze Kadzielnia wystpi: Ewelina Lisowska oraz Golec Uorkiestra.\\nOrganizatorem jest agencja Pop-Art.', '2017-02-23 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(15, 7, 4, 'Koncert Edyty Grniak', 'Koncert Edyty Grniak', 'Edyta Grniak, najwiksza gwiazda polskiej estrady, w tym roku obchodzi 25-lecie pracy artystycznej. Z tej okazji zaplanowaa wydanie nowej, dugo oczekiwanej pyty oraz tras koncertow Love 2 Love, pierwsz od 15 lat, na miar wiatowych produkcji. Wydarzenie jakiego w tym kraju jeszcze nie byo, przy kadym koncercie bdzie pracowa 150 osb. Artystka zaangaowaa si w tras na 110%, od kilku miesicy trwaj przygotowania, bierze lekcje taca oraz piewu w Nowym Jorku aby by w wietnej formie.\\nBilety w cenach 150 PLN VIP, 120 PLN, 100 PLN, 80 PLN, 60 PLN', '2017-02-27 19:05:00', , '2017-01-01 19:05:00'),
(16, 7, 4, 'Woska Gala Operowa', 'Woska Gala Operowa', 'Druga edycja Letniego Festiwalu Operowego zapowiada prawdziw uczt muzyczn. W tym roku Agencja Artystyczna Pro Musica proponuje znakomit Wosk Gal Operow.\\nBdzie to koncert z niespodziank, bo oprcz znanych i lubianych arii, duetw i chrw operowych (prawdziwych hitw operowych) zaprosimy publiczno do wsplnej zabawy', '2017-02-14 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(17, 7, 3, 'Polska Noc Kabaretowa', 'Polska Noc Kabaretowa', 'Zgodnie z dewiz, ze miech to zdrowie kolejna edycja najwikszego cyklicznego widowiska kabaretowego w Polsce dotyczy bdzie tematyki suby zdrowia. Jeszcze weselej, jeszcze bardziej absurdalnie i na niezmiennie najwyszym artystycznym poziomie.\\n W niemal czterogodzinnym show na scenie pojawi si Paranienormalni, Kabaret Moralnego Niepokoju, Nowaki oraz Ireneusz Krosny.', '2017-03-09 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(18, 9, 5, 'KPINY I KPINKI', 'KPINY I KPINKI', 'Stawiam na mdro tekstw Zauckiego i Mynarskiego, ich ponadczasowy charakter, celne pointy. Mam nadziej, e publiczno bdzie tym wyborem usatysfakcjonowana - mwi Mirosaw Bieliski, reyser.', '2017-03-14 19:05:00', , '2017-01-01 19:05:00'),
(19, 9, 5, 'WOJNA NIE MA W SOBIE NIC Z KOBIETY', 'WOJNA NIE MA W SOBIE NIC Z KOBIETY', 'Ksika Swietany Aleksijewicz pt. Wojna nie ma w sobie nic z kobiety zostaa opublikowana w 1985 roku, skada si z rozmw z kobietami, ktre walczyy w armii radzieckiej podczas II wojny wiatowej. Bohaterki milczay przez wiele lat. Po dugich staraniach, autorce udao si namwi je do zwierze. Opowiadaj o tym, w jaki sposb radziy sobie z problemami, na ktre mczyzna patrzy inaczej, lub w ogle ich nie dostrzega.', '2017-03-12 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(20, 11, 6, 'Rafaa Hadziewicza twrcze ycie', 'Rafaa Hadziewicza twrcze ycie', 'Pierwsza w historii monograficzna wystawa Rafaa Hadziewicza, twrcy blisko tysica obrazw i rysunkw. W zabytkowych wntrzach Dawnego Paacu Biskupw Krakowskich w Kielcach prezentowane bd dziea z kolekcji muzealnych, zbiorw prywatnych oraz kociow z caej Polski. Prace, ktre nie znajd si na wystawie, zostan zaprezentowane w formie multimedialnej. Ekspozycji towarzyszybdzie publikacja Rafaa Hadziewicza twrcze ycie, ktra zawiera katalog wszystkich dzie artysty oraz informacje o jego yciu i twrczoci.', '2017-03-13 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(21, 11, 6, 'Alicja. Ilustracje', 'Alicja. Ilustracje', 'Tradycyjnie ju w okolicach Dnia Dziecka zapraszamy najmodszych, ale te ich rodzicw na wyjtkow wystaw ilustracji, tym razem do Alicji w krainie czarw. Na ekspozycji zaprezentujemy 90 prac autorstwa ponad 70 ilustratorw pochodzcych z 16 krajw m.in. Woch, Portugalii, Hiszpanii, Niemiec, Wgier, Biaorusi, Litwy, otwy i oczywicie Estonii.', '2017-03-01 19:05:00', , '2017-01-01 19:05:00'),
(22, 11, 6, 'eromski w teatrze i kinie', 'eromski w teatrze i kinie', 'Wystawa powicona jest ekranizacjom i adaptacjom prozy eromskiego oraz sztukom teatralnym powstaym w oparciu o dziea pisarza. Jednak nie porwnywanie dzie literackich z ich filmowymi, czy teatralnymi adaptacjami jest tu istotne; kluczow kwesti jest pokazanie zwizkw literatury i filmu jako zjawisk fundamentalnych dla rozwoju kina oraz ewolucji samej literatury. Zestawiajc je ze sob, mamy bowiem moliwo zobaczenia jak si wzajemnie owietlaj, jakie cechy w wyniku takiego podejcia ujawniaj si najwyraniej.', '2017-03-02 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(23, 11, 6, 'Czas mierzony szwajcarskim zegarem', 'Czas mierzony szwajcarskim zegarem', 'Wystawa Czas mierzony szwajcarskim zegarem powicona jest dwm ostatnim latom ycia Henryka Sienkiewicza, ktre spdzi w Szwajcarii. Miasteczko Vevey pod Lozann stao si ostatni przystani wiecznego tuacza, jak zwyk o sobie mawia. Byy to wyjtkowe lata. Schorowany, blisko 70-letni pisarz nie zrezygnowa z dziaalnoci spoecznej. Przeraony ogromem zniszcze i ludzkiej krzywdy, jakie powodowaa przetaczajca si po polskich ziemiach wojenna zawierucha, postanowi nie pomoc rodakom. Stan na czele Generalnego Komitetu Pomocy Ofiarom Wojny w Polsce, organizacji, ktrej celem byo zbieranie za granic pienidzy i przekazywanie ich do kraju. Obok autora Trylogii wan rol w Komitecie odgrywa penicy funkcj wiceprezesa Ignacy Paderewski, Antoni Osuchowski, a take biskup krakowski Adam Sapieha.', '2017-03-05 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(24, 1, 7, 'Legion samobjcw / napisy', 'Legion samobjcw / napisy', 'Jak dobrze by zym. Zebra druyn zoon z najbardziej niebezpiecznych pojmanych superprzestpcw. Nastpnie przekaza im najpotniejsz bro, jak dysponuje rzd. Wreszcie wysa ich na misj, ktrej celem jest pokonanie tajemniczego, nieprzeniknionego bytu. Amanda Waller, oficer amerykaskiego wywiadu, dosza do wniosku, e do takiego zadania nada si jedynie zbieranina otrw, ktrzy nie maj absolutnie nic do stracenia. Co zrobi Legion Samobjcw, gdy jego czonkowie zorientuj si, e nie zostali wybrani dlatego, e maj szans wygra, ale dlatego, e nikt nie bdzie ich aowa, gdy ponios klsk? Czy dadz z siebie wszystko, choby mieli zgin, czy bd walczy tylko o przetrwanie?', '2017-03-09 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(25, 2, 7, 'Legion samobjcw / napisy', 'Legion samobjcw / napisy', 'Jak dobrze by zym. Zebra druyn zoon z najbardziej niebezpiecznych pojmanych superprzestpcw. Nastpnie przekaza im najpotniejsz bro, jak dysponuje rzd. Wreszcie wysa ich na misj, ktrej celem jest pokonanie tajemniczego, nieprzeniknionego bytu. Amanda Waller, oficer amerykaskiego wywiadu, dosza do wniosku, e do takiego zadania nada si jedynie zbieranina otrw, ktrzy nie maj absolutnie nic do stracenia. Co zrobi Legion Samobjcw, gdy jego czonkowie zorientuj si, e nie zostali wybrani dlatego, e maj szans wygra, ale dlatego, e nikt nie bdzie ich aowa, gdy ponios klsk? Czy dadz z siebie wszystko, choby mieli zgin, czy bd walczy tylko o przetrwanie?', '2017-03-15 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(26, 1, 7, 'Randka na weselu / napisy', 'Randka na weselu / napisy', 'Mike i Dave, dwaj doroli bracia, syn ze szczeniackich wygupw, ktre psuj kad rodzinn uroczysto. Gdy zostaj zaproszeni na wesele swojej siostry na Hawajach, rodzice stawiaj im warunek: musz pojawi si w towarzystwie dziewczyn, ktre w razie potrzeby bd mie na nich oko. Bracia umieszczaj w internecie ogoszenie, szukajc idealnych partnerek. Nie przypuszczaj nawet, e dwie dziewczyny, ktre poznaj, oka si jeszcze bardziej szalone i nieprzewidywalne ni oni sami, a sytuacja szybko wymknie si spod kontroli.', '2017-03-22 19:05:00', , '2017-01-01 19:05:00'),
(27, 1, 7, 'mietanka towarzyska / napisy', 'mietanka towarzyska / napisy', 'Nowa komedia Woodyego Allena  geniusza kina, zdobywcy czterech Oscarw i dwudziestu nominacji do tej nagrody. mietanka towarzyska jest jego 46. filmem. Akcja rozgrywa si w latach 30. ubiegego stulecia, a jej tem s modne kluby nocne, eleganckie przyjcia i malownicze zaktki Nowego Jorku i Los Angeles.\\n Bobby (Jesse Eisenberg) jest wraliwym romantykiem z Bronxu. Liczc na spenienie marze o wielkiej karierze, wyrusza w podr do Los Angeles, gdzie zaczyna prac u swojego wujka Phila (Steve Carrell)  agenta topowych gwiazd Hollywood. Na miejscu poznaje pikn sekretark Vonnie (Kristen Stewart). Chopak bez pamici zakochuje si w dziewczynie, nie wiedzc jeszcze, e ta znajomo wywrci jego ycie do gry nogami.', '2017-03-24 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(28, 3, 7, 'mietanka towarzyska / napisy', 'mietanka towarzyska / napisy', 'Nowa komedia Woodyego Allena  geniusza kina, zdobywcy czterech Oscarw i dwudziestu nominacji do tej nagrody. mietanka towarzyska jest jego 46. filmem. Akcja rozgrywa si w latach 30. ubiegego stulecia, a jej tem s modne kluby nocne, eleganckie przyjcia i malownicze zaktki Nowego Jorku i Los Angeles.\\n Bobby (Jesse Eisenberg) jest wraliwym romantykiem z Bronxu. Liczc na spenienie marze o wielkiej karierze, wyrusza w podr do Los Angeles, gdzie zaczyna prac u swojego wujka Phila (Steve Carrell)  agenta topowych gwiazd Hollywood. Na miejscu poznaje pikn sekretark Vonnie (Kristen Stewart). Chopak bez pamici zakochuje si w dziewczynie, nie wiedzc jeszcze, e ta znajomo wywrci jego ycie do gry nogami.', '2017-03-05 19:05:00', , '2017-01-01 19:05:00'),
(29, 10, 8, 'RECYKLING', 'RECYKLING', 'Targi RECYKLING odbd si po raz drugi. Tematyka targw obejmuje midzy innymi recykling wszystkich metali nieelaznych, szczeglnie miedzi, cynku, oowiu, metali lekkich, metali szlachetnych, krytycznych i innych zawartych w zomach, surowcach wtrnych, odpadowych, pproduktach, ciekach i innych.', '2017-02-19 19:05:00', , '2017-01-01 19:05:00');
INSERT INTO `wydarzenie` (`idWydarzenie`, `miejsce`, `kategoria`, `tytul`, `podtytul`, `opis`, `data`, `zdjecie`, `dataDodania`) VALUES
(30, 10, 8, 'KIELCE BIKE-EXPO', 'KIELCE BIKE-EXPO', 'Rower  narzdzie dla mionikw turystyki i rekreacji, ale te indywidualny rodek transportu. Z roku na rok obserwujemy wzrost liczby sympatykw jednoladw w Polsce i na wiecie. To wanie dla brany rowerowej dedykowane jest najwaniejsze wydarzenie tego sektora w Europie rodkowo  Wschodniej. VII Midzynarodowe Targi Rowerowe KIELCE BIKE-EXPO odbd si od 29 wrzenia do 1 padziernika 2016 w Targach Kielce.', '2017-03-09 19:05:00', , '2017-01-01 19:05:00');

